import React from "react";
import "./Menu.css";

const MenuDropDown = ({ logout, navigate, closeMenu }) => {
    return (
        <div className="dropdown-menu">
            <div onClick={() => { navigate("/profile"); closeMenu(); }}>Trang Tài Khoản</div>
            <div onClick={() => { navigate("/orders"); closeMenu(); }}>Đơn Hàng</div>
            <div onClick={() => { navigate("/wallet"); closeMenu(); }}>Lịch Sử Giao Dịch</div>
            <div onClick={() => { logout(); closeMenu(); }}>Đăng Xuất</div>
        </div>
    );
};

export default MenuDropDown;
